  true,\n\t\"url\": null,\n\t\"notes\": \"Datasets are for the US electricity grid
  system for eGrid regions rn(AKGD, AKMS, AZNM, CAMX, ERCT, FRCC, HIMS, HIOA, MROE,
  MROW, NEWE, NWPP, NYCW, NYLI, NYUP, RFCE, RFCM, RFCW, RMPA, SPNO, SPSO, SRMV, SRMW,
  SRSO, SRTV, SRVC) for 2008.  The rndata is provided in life cycle inventory forms
  (xls and xml) .  A rnmodule report and a detailed spreadsheet are also included.Datasets
  rninclude generation and transmission of electricity for each of the eGrid regions.
  \ It is representative of the year 2008 mix of rnfuels used for utility generations
  for each of the eGrid regions rnand is based on the EIA electricity reports for
  all power plants in the rnUS.  Detailed information on the methodology is included
  in the module rnreport and detailed spreadsheet.\",\n\t\"license_title\": \"Creative
